    (SLSMC). Estimates are in thousands of tonnes for the Seaway combined traffic and
    also broken down between the Montreal - Lake Ontario section and the Welland Canal
    section of the Seaway. Cargo estimates are given for total cargo, grain, government
    aid, iron ore, coal, dry bulk, liquid bulk, general cargo, and containerized cargo.
    Vessel transits are also displayed and broken down by loaded and ballast transits.",nt"license_title":
